function HeaderComponents() {
    return(
        <div className="headerClass">
            <h1>Contact Us: 0793894000</h1>
            <FontAwesomeIcon icon="fa-brands fa-instagram" />
            <label>Solvit Africa</label>
        </div>
    )
}

export default HeaderComponents;
